import './infoSidebar.css';

export default function InfoSidebar() {
  return (
    <div className='infoSidebar'>
        <div className="infoSidebarTitle">LIÊN HỆ CHÚNG TÔI</div>
        <div className="infoSidebarDetails">
        <div className="infosidevbarItemIcon"><NavigateNextIcon fontSize='small'/></div>
            <div className="infosidebarItemTitle">C sủi vị cam</div>
        </div>
    </div>
  )
}
